package gvcsa_test

import (
	"4420project/gvcsa"
	"4420project/suffixArray"
	"4420project/suffixTree"
	"fmt"
	"strings"
	"testing"
)

func TestMakeGVCSArray(t *testing.T) {
	str := ""
	str = strings.ReplaceAll(str," ","_")
	fmt.Println(str)
	array := suffixTree.NewSuffixTree(str).ToSuffixArray()
	sa := suffixArray.SuffixArray{Text: array.Text, POS: array.POS}
	gvcsArray:= gvcsa.MakeGVCSArray(sa)
	for i := 0; i < len(str); i++ {
		r1 := gvcsArray.Lookup(i)
		r2 := sa.POS[i]
		if r1 != r2{
			t.Error("wrong")
		}
	}
}